import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { withStyles } from '@material-ui/styles';
import {
    Card,
    CardHeader,
    CardContent,
    CardActions,
    Typography,
    Grid,
    Divider,
    Avatar,
    Button
} from '@material-ui/core';
import { StatusBullet } from 'components';
import { URI } from './../../../../constants/types';
import styles from './styles';

const statusColors = {
    true: 'success',
    false: 'danger'
};

const PresencesCard = props => {
    const { className, classes } = props;
    return (
        <Card className={clsx(classes.root, className)}>
            <CardHeader
                avatar={
                    <Avatar
                        src={
                            'http://www.gravatar.com/avatar/f8aef9003205946523250a062b54bbb6?s=200&r=pg&d=retro'
                        }
                    />
                }
                title={
                    <Typography variant="h5">
                        Mella Full Screen Slider
                    </Typography>
                }
                subheader={<Typography variant="body2">by She Fen</Typography>}
            />
            <CardContent>
                <Grid container spacing={3}>
                    <Grid item>
                        <Grid container direction="column" justify="space-between" spacing={3}>
                            <Grid item>
                                <Typography variant='h6'>2 day ago</Typography>
                                <Typography variant="body2">End Time</Typography>
                            </Grid>
                            <Grid item>
                                <Typography variant='h6'>12 November 2019</Typography>
                                <Typography variant="body2">Start Time</Typography>
                            </Grid>
                            <Grid item>
                                <Typography variant='h6'>Active</Typography>
                                <Typography variant="body2">Status</Typography>
                            </Grid>
                        </Grid>
                    </Grid>
                    <Grid item>
                        <Grid container direction="column" justify="space-between" spacing={3}>
                            <Grid item>
                                <Typography variant='h6'>12</Typography>
                                <Typography variant="body2">Total member</Typography>
                            </Grid>
                            <Grid item>
                                <Typography variant='h6'>12 November 2019</Typography>
                                <Typography variant="body2">End time</Typography>
                            </Grid>
                            <Grid item>
                                <Button color='primary' variant='outlined'>View</Button>
                            </Grid>
                        </Grid>
                    </Grid>
                </Grid>
            </CardContent>
        </Card>
    );
};
export default withStyles(styles)(PresencesCard);
